    organization: TeamSpark LLC
    url: https://teamspark.ai
  tools:
    - name: find_tool
      description: "Find and return tools from RUNNING SERVERS that can help accomplish the user's request. Use this function when you need to: - Discover what tools are available for a specific task - Find the right tool(s) before attempting to solve a problem - Check if required functionality exists in the current environment"
      parameters:
        type: object
        properties:
          tool_description:
            type: string
            description: Description of the task or capability needed (e.g., "web search", "analyze CSV file", "send an email")
      prompt: Call the tool "searchTools" with the query value "{tool_description}" and return the tools found
    - name: call_tool
      description: "Execute a specific tool with the provided parameters. Use this function to: - Run a tool after identifying it with find_tool() - Execute operations that require specific MCP server functionality - Perform actions that go beyond your built-in capabilities"
      parameters:
        type: object
        properties:
          tool_name:
            type: string
            description: The name of the tool to execute
          parameters:
            type: string
            description: Dictionary of arguments required by the tool
      prompt: Run the tool "{tool_name}" with the parameters "{parameters}" (if any) and return the result
